import React from "react";
import ReactHtmlParser from "react-html-parser"
import { Table, Td, TdLeft, TdRight} from "../PackPromoElement"

const Decollage = ({ content }) => {

    return(
        <Table>

            {
                content.map((el, index) =>(

                    <Td>
                        <TdLeft>{ReactHtmlParser(el.title)}</TdLeft>
                        <TdRight>{ReactHtmlParser(el.description)}</TdRight>   
                    </Td>

                ))
            }
        </Table>
    )
}

export default Decollage
